import React from 'react';
import { Button } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import { Link } from "react-scroll";
import Links from './Links';

const useStyles = makeStyles((theme) => ({


    buttonContainerStyles: {
        width: '100%',
        height: '600px',
        marginTop: '90px',
        marginLeft: '20%',
        textAlign: 'right'
    },

    buttonStyles:{
        fontSize: '20px',
        border: 'solid 1px rgb(228, 130, 74)',
        borderRadius: '50%',
        backgroundColor: 'black',
        color: 'rgb(228, 130, 74)',
        textTransform: 'none',
        width: '120px',
        height: '120px',
        '&:hover': {
            border: 'solid 4px rgb(228, 130, 74)',
            background: '#000000'
        }
    },

    goBack:{
        fontSize: '20px',
        border: 'solid 1px rgb(228, 130, 74)',
        borderRadius: '50%',
        backgroundColor: 'black',
        color: 'rgb(228, 130, 74)',
        textTransform: 'none',
        width: '120px',
        height: '120px',
        display: 'inline-block',
        '&:hover': {
            border: 'solid 4px rgb(228, 130, 74)',
            background: '#000000'
        }
    },


    line:{
        height: '40px',
        borderLeft: '3px solid rgb(228, 130, 74)',
        width: '5px',
        marginLeft: '60px',
        transform: 'skewY(20deg)'

    },
    
}));

const SeeProjects = () => {
    
    
    const classes =  useStyles();
    return(
        <div className={classes.buttonContainerStyles}>

            <Link
                        activeClass="active"
                        to="projects"
                        spy={true}
                        smooth={true}
                        offset={-70}
                        duration= {500}
            >
                <Button className={classes.buttonStyles} >See <br></br>Projects</Button>
            </Link>
            <div className={classes.line}>

            </div>
            <Links />
        </div>
    )
}


export default SeeProjects;
